/**
 * @typedef {Object} EasingObject Object containing easing functions
 * @property {Function} In - Easing 'In' function. Should use the signature (k:number):number.
 * @property {Function} Out - Easing 'Out' function. Should use the signature (k:number):number.
 * @property {Function} InOut - Easing 'InOut' function. Should use the signature (k:number):number.
 */

/**
 * Linear Easing
 * @type {EasingObject}
 */
export const Linear: any;

/**
 * Quadratic Easing
 * @type {EasingObject}
 */
export const Quadratic: any;

/**
 * Cubic Easing
 * @type {EasingObject}
 */
export const Cubic: any;

/**
 * Quartic Easing
 * @type {EasingObject}
 */
export const Quartic: any;

/**
 * Quintic Easing
 * @type {EasingObject}
 */
export const Quintic: any;

/**
 * Sinusoidal Easing
 * @type {EasingObject}
 */
export const Sinusoidal: any;

/**
 * Exponential Easing
 * @type {EasingObject}
 */
export const Exponential: any;

/**
 * Circular Easing
 * @type {EasingObject}
 */
export const Circular: any;

/**
 * Elastic Easing
 * @type {EasingObject}
 */
export const Elastic: any;

/**
 * Back Easing
 * @type {EasingObject}
 */
export const Back: any;

/**
 * Bounce Easing
 * @type {EasingObject}
 */
export const Bounce: any;
